  const svgRef = useRef();

  useEffect(() => {
    // setting up svg
    const w = 400;
    const h = 100;
    const svg = d3
      .select(svgRef.current)
      .attr("width", w)
      .attr("height", h)
      .style("background", "#d3d3d3")
      .style("margin-top", "50");
    // setting the scaling
    const xScale = d3.scaleLinear()
      .domain([0, data.length - 1]);
    // seting the axes
    // setting up the data for the svg
  }, [data]);

  return (
    <div className="App">
      <h1 className="text-5xl font-bold underline italic">Hello world!</h1>
      <svg ref={svgRef}></svg>
    </div>
  );
}

export default App;
